import { useEffect, useState } from "react"


const Header = () => {
    const [time, setTime] = useState(Date.now()) 

    useEffect(() => {
        const interval = setInterval(() => {
            setTime(Date.now())
        }, 1000);

        return () => clearInterval(interval)
    }, [])

    return (
        <h1> {time} </h1>
    )
}

export default Header
